    "text": "Is it just me or were you also taught that the Nazis had really good propaganda, but never what that propaganda looked like? Because how I was taught about it was that the Nazis effectively were able to propagandaize and indoctrinate a whole entire nation into hating Jewish people and that it was because of their good propaganda, but I was never told what that looked like. And I think that's fucking dangerous because the anti-Semitic tropes that they use to justify harm back then are being used now. The anti-trans, the anti-queer, the anti-roma, even the anti-slavic tropes that they're using are still used today to do it. So for example, I'll speak on like my communities of like queer people. The trope of gay people and trans people being child groomers was explicitly used by the Nazis when talking about trans people. The idea that communists and socialists are terroristic agitators is literally what justified the enabling act following the Reichstag fire. The Nazis were not able to do what they did simply because they were a heinous, totally new type of evil. Don't get me wrong, they were fundamentally evil. They were able to do what they did though because they played the propaganda game. They looked for excuses, they looked for people to blame, and that looks like a lot of different ways. They made excuses, they have plausible demisability. When trying to gain the acceptance of German people of having concentration camps in their society, they had a model concentration camp that they showed the media that was much cleaner and nicer and better, obviously, than what actual concentration camps looked like. When people resisted, they stepped back. They were obsessed with maintaining popular support, and it is important to understand how they moved to build and maintain that popular support because modern day fascists will follow the same activities. I really fear the reason we were not taught in depth, how they actually did this, even though this type of propaganda is some of the most fundamental to countering fascism, is because our education system and our media and a lot of what our politics are based in are leveraging very similar propaganda techniques. This is not to say it's the same, but I do have it very difficult to distinguish between the type of propaganda that I was exposed to following 9-11 regarding Arabs and Muslims and things that I've seen from Mussolini or Salazar or Franco. The abjectification, the dehumanization of these people used to justify and completely ignore brutalization, expulsion, violation of their fundamental rights in Gitmo, all because they have a different culture or because people that looked like them did something bad or because some kind of confusing facts led to one of the leaders of one of their countries may be doing something that didn't quite follow international law. So it's really concerning that we weren't given the tools to undermine fascist propaganda.",
