    "text": "I don't believe in prisons and neither should you. And that is to say, you don't believe in punitive justice. So let's break down what that looks like. Because I agree it's hard to imagine the world without prisons. But let's break down what prisons are. There are two things, basically. There are slave camps because slavery is legal within them. That's a very defining feature of prisons. And number two, the reasons people go in them is punitive justice as a main justifying ideology. That is to say, it's not that we think society is better off because we put them there. It is because we think they deserve to be there by merit of what they did. And that would be different than, for example, rehabilitative justice. We're placing people who need to be rehabilitated to be better for society in places where they can rehabilitate. Or like a very intramentalist view where we only put people away from society. We restrict their liberty if they physically can't be within society safely. Right? But it's not a punishment. We're not saying you did something bad. And so we're just going to treat you bad. It's just saying this is what's best for society. And I personally ascribe to those latter two much more than I will ever say, you did something bad. Therefore you deserve to have bad done to you. I think that is immoral. I think that is wrong. So when I say abolish prisons, I don't mean abolish places that we send people who do bad things. I mean abolish places that we send people who do bad things because they do bad things. Do you understand? So if someone's like a serial killer and says they're going to do it again if they go outside, yeah, I want to put them to another place. I just don't think it should be number one, a slave camp where they are slaves because I don't believe in slavery. And I don't believe number two, it should be unduly harsh because that person, why would we abuse this person? What's the goal? What is our aim? Is it to convince them to stop doing it? Because statistically, the best way to prevent someone from committing crimes again is to rehabilitate them and then release the back into society so that they are productive. But if it is just to be abusive, it is just to cause harm. I don't believe in that. And we have some models for this. We have models of like the Nordic countries, for example, which have their problems, but put people in jail for much, much less time and have fewer crimes and the people that work criminals commit less crimes after they're released on average. This is because they have rehabilitative programs within these prisons. And we have a bunch of countries that don't have slavery legal within their countries of prisons. So yeah, when I say I want to abolish prisons, I don't mean I don't want somewhere for people to go where they're literally going to immediately kill someone else. But it does mean that if you do a non-violent offense, I don't see why we would separate you from society. I really don't. I don't see why we would punish you. I don't see the justification unless you were going to do it again, in which case, there are much better ways to do it than just abusing the fuck out of you, which is what prisons are. And finally, I just don't see any excuse for slavery within them. So that's what I mean by abolishing prisons. It's very complicated and I can't cover it in a three minute video. But if you have more questions from that, that's the general ethos of the assertion.",
